import React from 'react';

function Auth() {
  return (
    <div className="pt-11 flex flex-col w-2/3">
      <div className="flex flex-row">
        <div className="bg-red-300 w-1/2 h-[45vh]">1</div>
        <div className="bg-green-300 w-1/2 h-[45vh]">1</div>
      </div>
      <div className="bg-yellow-300 h-[45vh]">1</div>
    </div>
  );
}

export default Auth;
